//////////////////////////////////////
//// UTILS

static void set_array_values (double* data, double value,  int size) 
{
    if (data == NULL)
    {
	return;
    } else {
	for (int i=0; i<size; i++) {
	    data[i] = value;
	}
    }
}

//////////////////////////////////////
//// PRINT UTILS
static void print_array (double* data, int size) 
{
    printf ("[");
    if (data == NULL) {
	printf("empty");
    } else {
	for (int i=0; i<size; i++) {
	    printf("%e,", data[i]);
	}
    }
    printf("]\n");
}

static void print_array (float* data, int size)
{
    printf ("[");
    if (data == NULL) {
	printf("empty");
    } else {
	for (int i=0; i<size; i++) {
	    printf("%e,", data[i]);
	}
    }
    printf("]\n");
}

static void print_vec_type (G2G::vec_type<double,4>* data, int size) 
{
    printf ("[");
    if (data == NULL) {
	printf("empty");
    } else {
	for (int i=0; i<size; i++) {
	    printf("(%f,%f,%f),", data[i].x, data[i].y, data[i].z);
	}
    }
    printf("]\n");
}


static void print_accumulate_point_data (G2G::vec_type<double,4>* dxyz, G2G::vec_type<double,4>* dd1, 
    G2G::vec_type<double,4>* dd2, double* energy, double* factor, double* point_weights,
    double* partial_density, int number_of_points)
{
    printf("=========\n");
    printf("= Data  =\n");
    printf("=========\n");
    printf("dxyz:"); print_vec_type(dxyz, number_of_points);
    printf("dd1:"); print_vec_type(dd1, number_of_points);
    printf("dd2:"); print_vec_type(dd2, number_of_points);
    printf("energy:"); print_array(energy, number_of_points);
    printf("factor:"); print_array(factor, number_of_points);
    printf("point_weights:"); print_array(point_weights, number_of_points);
    printf("partial_density:"); print_array(partial_density, number_of_points);
    printf("=========\n");

}

